import React from "react";

let navStyle = {
    display: "flex"
}



function FullName() {


    return(
        <div>
            <nav style={navStyle}>
                <h1>Ahmed Amine Merzougui<br></br>Full Stack Js Developer</h1>
                <div>
                <a className="a-1" href="#">HOME</a>
                <a className="a-2" href="#">RESUME</a>
                <a className="a-3" href="#">PROJECTS</a>
                <a className="a-4" href="#">CONTACT</a>
                </div>
            </nav>
        </div>
    );
}

export default FullName;
